class Title extends React.Component {
	constructor(chart, options) {
		super(chart, options);
		this.chart = chart;
		this.options = options;
	};

	render() {
		console.log("Title",this.options.title)
		return (<h2>this.options.title</h2>)
	};
}

export default Title;
